import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
const obj = { a: 23, b: 7, c: 14 };
let a = 0;
let b = 0(({ a, b } = obj));

console.log(a, b);
